INSERT INTO `post` VALUES (1,'2023-03-31 10:34:45.794001','2023-03-31 10:34:48.271939','캐나다','브리티시컬럼비아','노스벤쿠버','그라우스','https://mydanimbucket.s3.ap-northeast-2.amazonaws.com/Danim/Nation/de111581-1200-4400-af1f-7fc825851b83.png','여기 지금 그라우스 마운틴이 올라왔는데 지금 아직 5월인데도 불구하고 너무 아 고도 높은 곳에 처음. 와봤는데 진짜 춥네요.',12.58521556854248,'https://mydanimbucket.s3.ap-northeast-2.amazonaws.com/Danim/Voice/30bf1ec7-a466-437d-ad39-9de57f59b579.wav',1,1),(2,'2023-03-31 10:35:43.633603','2023-03-31 10:35:46.194754','미국','로스앤젤레스','샌디에고','라호야','https://mydanimbucket.s3.ap-northeast-2.amazonaws.com/Danim/Nation/f33146ed-1691-4ef3-9eeb-13a9c2e4c5e6.png','라호야 비치라고 여기 야생 물개들이 와서 쉬는 서식지라고 합니다. 별로 냄새가 심할 줄 알았는데 냄새는 안 나고 귀엽긴 하네요. 근데',13.374693870544434,'https://mydanimbucket.s3.ap-northeast-2.amazonaws.com/Danim/Voice/c75865ed-ef81-4b59-b954-ce5a9bfe27ab.wav',2,1),(3,'2023-03-31 10:35:53.445630','2023-03-31 10:35:55.540817','캐나다','알버타','로키','로키산맥','https://mydanimbucket.s3.ap-northeast-2.amazonaws.com/Danim/Nation/de111581-1200-4400-af1f-7fc825851b83.png','여러분들 로키마운트입니다. 로키 마운트 이거 진짜 넓네 산이 어떻게 저렇게 높지 말이 안 된다 말',11.377778053283691,'https://mydanimbucket.s3.ap-northeast-2.amazonaws.com/Danim/Voice/12e7d6b1-1aec-4234-85fe-3c254108035c.wav',1,1),(4,'2023-03-31 10:38:22.746108','2023-03-31 10:38:25.079312','미국','로스앤젤레스','샌디에고','발보아','https://mydanimbucket.s3.ap-northeast-2.amazonaws.com/Danim/Nation/f33146ed-1691-4ef3-9eeb-13a9c2e4c5e6.png','여기 발보아 파크인데 여기 옛날에 상속자들에 나왔다고 하는 거기인데 저는 몰랐는데 여기가 그런 곳이라고 합니다. 샌디에이고 있는 건데 주변에 동물원도 있어요.',14.512471199035645,'https://mydanimbucket.s3.ap-northeast-2.amazonaws.com/Danim/Voice/e2174030-9185-45c6-aa39-733e43341859.wav',2,1),(5,'2023-03-31 10:38:32.249905','2023-03-31 10:38:34.111089','미국','오리건','포틀랜드','멀트노마','https://mydanimbucket.s3.ap-northeast-2.amazonaws.com/Danim/Nation/f33146ed-1691-4ef3-9eeb-13a9c2e4c5e6.png','미국 오리건주에 빅풋이 나왔다고 해서 와봤는데 빅풋은 없고 기념품만 팔고 근데 폭포는 멋지네요.',10.983038902282715,'https://mydanimbucket.s3.ap-northeast-2.amazonaws.com/Danim/Voice/36052be4-62c8-46e5-992f-7961133b1075.wav',2,1),(6,'2023-03-31 10:38:54.252410','2023-03-31 10:38:56.658479','미국','오리건','시애플','스타벅스','https://mydanimbucket.s3.ap-northeast-2.amazonaws.com/Danim/Nation/f33146ed-1691-4ef3-9eeb-13a9c2e4c5e6.png','여기 지금 스타트 벅스 본점에 와 있는데 제가 이런 곳에 와볼 거라고는 생각도 못 해봤는데 텀블러 살까 말까 고민했는데 텀블러는 안 사겠습니다. 나중에 후회할지 모르겠는데',13.467574119567871,'https://mydanimbucket.s3.ap-northeast-2.amazonaws.com/Danim/Voice/55c5bdab-96db-4052-b133-f57c3e0235fc.wav',2,1),(7,'2023-03-31 10:39:00.771552','2023-03-31 10:39:02.691358','캐나다','알버타','로키','에메랄드레이크','https://mydanimbucket.s3.ap-northeast-2.amazonaws.com/Danim/Nation/de111581-1200-4400-af1f-7fc825851b83.png','여러분들 여기 에메랄드 레이크인데요. 어떻게 물 색깔이 저럴 수가 있죠. 저게 빙하에서 나온 물이라고 하는데 확실히 다르긴 하네요. 여기가 정말 멋집니다. 여러분',13.258594512939453,'https://mydanimbucket.s3.ap-northeast-2.amazonaws.com/Danim/Voice/41dd736a-cdc3-48fe-a048-3bde497a15cd.wav',1,1),(8,'2023-03-31 10:39:13.988024','2023-03-31 10:39:15.765451','미국','유타','어딘','\"\"','https://mydanimbucket.s3.ap-northeast-2.amazonaws.com/Danim/Nation/f33146ed-1691-4ef3-9eeb-13a9c2e4c5e6.png','제가 요리하는 스테이크입니다. 안에 보세요. 미디엄 레어 야무지게 먹어야지',10.68117904663086,'https://mydanimbucket.s3.ap-northeast-2.amazonaws.com/Danim/Voice/5f2ebc06-4c0a-4e91-9df3-3f100cf01bfe.wav',2,1),(9,'2023-03-31 10:39:19.831974','2023-03-31 10:39:22.457795','캐나다','브리티시컬럼비아','벤쿠버','잉글리시베이','https://mydanimbucket.s3.ap-northeast-2.amazonaws.com/Danim/Nation/de111581-1200-4400-af1f-7fc825851b83.png','여기 잉글리시 베이인데 진짜 노리 멋지네요. 진짜 죽입니다. 죽여 너무 좋다.',8.614603042602539,'https://mydanimbucket.s3.ap-northeast-2.amazonaws.com/Danim/Voice/899e8b35-7535-4195-8044-fb41c108661a.wav',1,1),(10,'2023-03-31 10:39:36.474612','2023-03-31 10:39:38.730264','캐나다','브리티시컬럼비아','벤쿠버','잉글리시베이','https://mydanimbucket.s3.ap-northeast-2.amazonaws.com/Danim/Nation/de111581-1200-4400-af1f-7fc825851b83.png','오늘 밴쿠버 파이어워크 페스티벌 왔는데 한국 팀 하는 건데 진짜 멋지네요. 어떻게 진짜 한국에서도 이런 거 있었으면 좋겠네요.',12.770975112915039,'https://mydanimbucket.s3.ap-northeast-2.amazonaws.com/Danim/Voice/a0fd